import classes from "./Input.module.css";

const Input = (props) => {
  console.log(props.input);
  return (
    <div className={classes.input}>
      {/* for는 예약어이기 때문에 htmlFor를 사용. htmlFor에 input의 아이디나 네임을 적어 인풋과 연결 */}
    </div>
  );
};

export default Input;
